/**
 * Protect a PERR_OptLayout from the ATerm garbage collector. Every PERR_OptLayout that is not rooted somewhere on the C call stack must be protected. Examples are global variables
 * \param[in] arg pointer to a PERR_OptLayout
 */
void _PERR_protectOptLayout(PERR_OptLayout *arg) {
  ATprotect((ATerm*)((void*) arg));
}

/**
 * Unprotect a PERR_OptLayout from the ATerm garbage collector. This improves the efficiency of the garbage collector, as well as provide opportunity for reclaiming space
 * \param[in] arg pointer to a PERR_OptLayout
 */
void _PERR_unprotectOptLayout(PERR_OptLayout *arg) {
  ATunprotect((ATerm*)((void*) arg));
}

