/**
 * Assert whether a PERR_AreaAreas is any of the valid alternatives, or not. This analysis does not go any deeper than the top level
 * \param[in] arg input PERR_AreaAreas
 * \return ATtrue if #arg corresponds to the expected signature, or ATfalse otherwise
 */
ATbool PERR_isValidAreaAreas(PERR_AreaAreas arg) {
  if (PERR_isAreaAreasEmpty(arg)) {
    return ATtrue;
  }
  else if (PERR_isAreaAreasSingle(arg)) {
    return ATtrue;
  }
  else if (PERR_isAreaAreasMany(arg)) {
    return ATtrue;
  }
  return ATfalse;
}

